import React from 'react';
import PropTypes from 'prop-types';
import Layout from '../components/Layout';

const Backpot = ({ Component }) => {
  return (
    <Layout>
      <Component />
    </Layout>
  );
};

Backpot.propTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default Backpot;
